import React from "react";
import { Switch, Route } from 'react-router-dom';
import NavBar from "./NavBar";
import Cart from "./Cart";
import User from "./User";

function App() {



    return (
        <div className="App">
            <NavBar />
            <Switch>
                <Route exact path="/cart">
                    <Cart />
                </Route>
                <Route exact path="/user">
                    <User />
                </Route>
            </Switch>
        </div>
    )
}

export default App;
